const InitialState = {
    nothing: null
}
export const testReducer = (state=InitialState,action) => {
    debugger
    switch (action.type) {
        case 'TEST': {
            return {
                ...state,
                test: action.test,
            }

        }

        default:
            return state
    }
}


export const testAC = (test) => ({type:'TEST',test});
